import React from 'react';

export default function PetList(props) {
    let dogCards = props.pets.map((dog) => {
      return <PetCard petData={dog} key={dog.name} adoptCallback={props.adoptCallback} />;
    })

    return (
      <div>
        <h2>Dogs for Adoption</h2>
        <div className="card-deck">
          {dogCards}
        </div>
      </div>
    );
  }

function PetCard(props) {

  let mutt = props.petData;

  const handleClick = () => {
    console.log("You clicked on", mutt.name);
    props.adoptCallback(mutt.name);
  }

  return (
    <div className="card" onClick={handleClick}>
      <img className="card-img-top" src={mutt.img} alt={mutt.name} />
      <div className="card-body">
        <h3 className="card-title">{mutt.name} {mutt.adopted ? '(Adopted)' : ''}</h3>
        <p className="card-text">{mutt.sex} {mutt.breed}</p>
      </div>
    </div>
  );
}
